import { ComponentPortal, DomPortalOutlet } from '@angular/cdk/portal';
import {
    ApplicationRef,
    ComponentFactoryResolver,
    Directive,
    ElementRef,
    Injector,
    Input,
} from '@angular/core';
import { LoadingComponent } from '../../Atoms/loading';

@Directive({
    selector: '[loader]',
})
export class LoaderDirective {
    @Input() set loader(status: boolean) {
        this.on(status);
    }

    @Input() loaderSize?: string;
    @Input() loaderColor: string = 'principal';

    private host!: DomPortalOutlet;

    constructor(
        private elementRef: ElementRef<HTMLElement>,
        private cfr: ComponentFactoryResolver,
        private appRef: ApplicationRef,
        private injector: Injector
    ) {}

    on(status: boolean): void {
        const element = this.elementRef.nativeElement;
        if (status) {
            element.classList.add('ds-in-loading');
            this.create();
        } else {
            element.classList.remove('ds-in-loading');
            this.host?.detach();
        }
    }

    create(): void {
        const component = new ComponentPortal(LoadingComponent);
        this.host = new DomPortalOutlet(
            this.elementRef.nativeElement,
            this.cfr,
            this.appRef,
            this.injector
        );
        const componentRef = this.host.attach(component);

        componentRef.instance.color = this.loaderColor;
        if (this.loaderSize) {
            componentRef.instance.size = this.loaderSize;
        }
    }
}

import { Directive, ElementRef, Input, OnInit } from '@angular/core';

@Directive({
   selector: '[testid]',
})
export class TestIdDirective implements OnInit {
   @Input() set testid(name: string) {
      this._name = name;
   }
   _name: string = '';

   constructor(private elementRef: ElementRef<HTMLElement>) {}

   ngOnInit(): void {
      this.on();
   }

   on() {
      const { id, nodeName } = this.elementRef.nativeElement;
      const name =
         this._name || nodeName.replace(/^UI-/, '').toLocaleLowerCase();
      const test = `testid-${name}-${id}`;
      this.elementRef.nativeElement.setAttribute(
         'data-testid',
         test.endsWith('-') ? test.slice(0, -1) : test
      );
   }
}

