})
export class LoadingComponent {
    _color?: string;
    @Input() on: boolean = true;
    @Input() size?: string;
    @Input() set color(color: string) {
        if (this.on) color += '-on';
        this._color = `var(--token-color-${color}-light)`;
    }
}

